import './index.css';
import React from "react";

function TodoMenu() {
  function hi() {
    console.log('Se ejecutó correctamente');
  }

  return (
    <nav className="todoNav">
      <div className='todoNameSpan'>TODOS</div>
      <ul className="todoNav-list">
        <li className="todoNav-list__item" onClick={showActiveTodos}>Active</li>
        <li className="todoNav-list__item" onClick={hi}>Completed</li>
        <li className="todoNav-list__item" onClick={hi}>All</li>
      </ul>
    </nav>
  );
}

export { TodoMenu };
